import React, { useState } from 'react'
import "./style.css";
function Login() {
    const [email,setEmail]=useState("");
    const [phone,setPhone]=useState("");
    const [pass,setPass]=useState("");
    const [Pass_conf,setPass_conf]=useState("");
    const [allEntry,setAllentry]=useState([]);
    const submitfrom=(e)=>{
        e.preventDefault();
        
        if(email && phone && pass && Pass_conf){
            if(pass.length >= 4) {
                if(pass==Pass_conf){
                    const newEntry={
                        id:new Date().getTime().toString(),
                        email,
                        phone,
                        pass,
                        Pass_conf
                    }
                    setAllentry([...allEntry,newEntry]);
                    setEmail("");
                    setPass("");
                    setPass_conf("");
                    setPhone("");
                }
                else{
                    alert('ðŸ˜Œ Password Can be not Same ðŸ˜Œ');    
                }

            }
            else{
                alert('ðŸ˜Œ Password must be more than 4 Characters ðŸ˜Œ');
            }

        }
        else{
            alert('ðŸ˜Œ Plase fill the Data ðŸ˜Œ');
        }
    }
  return (
    <>
<div className="container">
	<div className="screen">
		<div className="screen__content">
			<form className="login" action='' onSubmit={submitfrom}>
				<div className="login__field">
					<i className="login__icon fas fa-user"></i>
					<input type="email" className="login__input" placeholder=" Email" required 
                        value={email}
                        onChange={(e)=>setEmail(e.target.value)}
                    /><br></br>
                    <span></span>
				</div>
                <div className="login__field">
					<i className="login__icon fas fa-user"></i>
					<input type="number" className="login__input" placeholder="Phone Number" 
                        value={phone}
                        onChange={(e)=>setPhone(e.target.value)}
                    /><br></br>
                    <span></span>
				</div>
                <div className="login__field">
					<i className="login__icon fas fa-user"></i>
					<input type="password" className="login__input" placeholder="Password" 
                        value={pass}
                        onChange={(e)=>setPass(e.target.value)}
                    /><br></br>
                    <span></span>
				</div>
				<div className="login__field">
					<i className="login__icon fas fa-lock"></i>
					<input type="password" className="login__input" placeholder="Password Confirm" 
                        value={Pass_conf}
                        onChange={(e)=>setPass_conf(e.target.value)}
                    /><br></br>
                    <span></span>
				</div>
				<button className="button login__submit" type='submit'>
					<span className="button__text">Log In Now</span>
				</button>				
			</form>
			<div className="social-login">
				<h3>log in via</h3>
				<div className="social-icons">
					<a href="#" className="social-login__icon fab fa-instagram"></a>
					<a href="#" className="social-login__icon fab fa-facebook"></a>
					<a href="#" className="social-login__icon fab fa-twitter"></a>
				</div>
			</div>
		</div>
		<div className="screen__background">
			<span className="screen__background__shape screen__background__shape4"></span>
			<span className="screen__background__shape screen__background__shape3"></span>		
			<span className="screen__background__shape screen__background__shape2"></span>
			<span className="screen__background__shape screen__background__shape1"></span>
		</div>
        <table>{
        allEntry.map((curr)=>{
            const {email,phone,id}=curr;
            return(
            <tr key={id}>
                <th>{email}</th>
                <th>{phone}</th>
            </tr>                
            )
        })
    }

        <tr>
            <th></th>
        </tr>
    </table>		
	</div>
</div>
    </>
  )
}
export default Login
